import React from 'react';
// import './About.css';

const About = () => {
    return (
        <div className="About">
            <text>About PAGE</text>
            <button type="button"><a href="/home">Home</a></button>
            <button type="button"><a href="/About">About</a></button>
            <button type="button"><a href="/art">Art</a></button>
            <button type="button"><a href="/resume">Resume</a></button>
        </div>   
    )
};

export default About;
